import { getAllTodo } from "../redux/action";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";


const ToDo = ()=> {

    const dispatch = useDispatch();

    const todos = useSelector(state => state.todos);
    
    useEffect(()=> {
        dispatch(getAllTodo());

    },[])

    return (
        <>
        <article>
        <ul>
            { todos.map((todo)=>(
                    <li>
                    {todo.data}
                        
                    </li>
                ))}
        </ul>   
        </article>
        </>
    )

}

export default ToDo ;
